window.bookSummaryJSON = "<p><b>My fate is bonded to two princes—one born of blood, the other of power—but my trust lies in neither.</b></p> <p>My skin is cursed by the stars, my fate damned by desire.</p> <p>When the dark prince offers me a bargain that will save his people and my life, the cruel and intoxicating male gives me no choice. Our union is his revenge, and I am his sacrifice.</p> <p>His lies are unforgivable. His wicked touch still bathes me in sin. He is my mate, and he is tortured by a curse to protect his people from his own family.</p> <p>I can now see him for exactly who he is. So why can’t I get his alluring touch out of my head?</p> <p>I am the key to saving his kingdom, but he alone has the power to ruin me.</p>"; 
